  false,\n\t\"url\": null,\n\t\"notes\": \"This document is a general approach towards
  a mini-joint venture between Near River Migratory Bird Refuge and Utah State University.
  \ It is focused on the Great Salt Lake Ecosystems Wetlands, the degradation on them
  and how to repair them with wildlife conservation projects, which may include obtaining
  property interest in lands or water and performing restoration, management ans enhancement
  of wetland ecosystems.    This proposal for a joint venture is built around the
  chronic and severe problem of avian botulism in the Great Salt Lake Ecosystem.\",\n\t\"owner_org\":
